Some of these don't seem to fit any of the categories. For example, "yay" is completely void of any context. Also, one of the examples contained multiple categories:&#13;
&#13;
"thanks for rebasing. Let me get someone to review this :-) &#13;
&#13;
Cheers, &#13;
Arun&#13;
&#13;
cc/ @spastorino can you look this PR ?"&#13;
&#13;
This could be mention, gratitude, and event confirmation, correct?

The first one has three potential answers to me: an answer, a URL, and a bug. I picked "answer" because I believe it embodied all of it.&#13;
&#13;
The second one has two potential answers to me: gratitude and mention. I think that mention is the more direct consequence.
